def solve_sudoku(board):
    def find_empty():
        for row in range(9):
            for col in range(9):
                if board[row][col] == '.':
                    return (row, col)
        return None

    def possible_numbers(r, c):
        used = set()
        # Check row
        for x in range(9):
            if board[r][x] != '.':
                used.add(board[r][x])
        # Check column
        for x in range(9):
            if board[x][c] != '.':
                used.add(board[x][c])
        # Check subgrid
        start_r = (r // 3) * 3
        start_c = (c // 3) * 3
        for x in range(start_r, start_r + 3):
            for y in range(start_c, start_c + 3):
                if board[x][y] != '.':
                    used.add(board[x][y])
        possible = []
        for num in range(1, 10):
            if num not in used:
                possible.append(num)
        return possible

    def solve():
        empty = find_empty()
        if not empty:
            return True
        row, col = empty
        for num in possible_numbers(row, col):
            board[row][col] = num
            if solve():
                return True
            board[row][col] = '.'  # backtrack
        return False

    solve()
    return board
